// Import necessary components and libraries
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Header';
import Home from './components/Home';
import People from './components/People';
import Biosensing from './components/Biosensing';
import EBeam from './components/EBeam';
import EnergyStorage from './components/EnergyStorage';
import Login from './components/Login';
import Biosensor from './components/Biosensor';

function App() {
  return (
    <Router>
      <Header />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/People" element={<People />} />
          <Route path="/Biosensing" element={<Biosensing />} />
          <Route path="/EBeam" element={<EBeam />} />
          <Route path="/EnergyStorage" element={<EnergyStorage />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/Biosensor" element={loggedIn ? <Biosensing /> : <Login onLogin={handleLogin} />} />        
        </Routes>
      </div>
    </Router>
  );
}

export default App;
